import {useEffect, useState} from "react";
import {connect} from "react-redux";
import {Redirect} from "react-router-dom";

const Type_number = (props) => {
    useEffect(() => {
        props.info=(JSON.parse(localStorage.getItem('testObject')));
        //localStorage.setItem('testObject', JSON.stringify(info));
        localStorage.removeItem('image');
    },[]);

    const [inx, setInx] = useState(props.numberMain);
    const [error, setError] = useState(false);
    const changeMinus = () => {
        let x = Number(inx) - 1;
        setInx(x);
    }
    const changePlus = () => {
        let x = Number(inx) + 1;
        setInx(x);
    }
    const addToLocalStorage = () =>{
        let z = props.info.length+1;
        props.info.push({id: z, number: inx});
        localStorage.setItem('testObject', JSON.stringify(props.info));
    }
    let baseUrl = `https://cdn3.riastatic.com/photosnew/auto/photo/__${inx}${props.numberMainLetter}.jpg`;

    if (error) return <Redirect to='/404'/>
    return (
        <>
            <div className='Car_app'>
                <img className='Car_app_IMG' src={baseUrl} alt="noImg"/>
                <div className='Car_app_align_button'>
                    <button onClick={() => changeMinus()}>Left</button>
                    <button onClick={() => addToLocalStorage()}>Add</button>
                    <button onClick={() => changePlus()}>Right</button>

                </div>
                <div className='findNewCar'>
                    <button onClick={() => setError(true)}>Find Another Car</button>
                </div>


            </div>
        </>
    );

}
let MapStateToProps = (state) =>( {
    numberMain: state.showPage.MainNumberURL,
    numberMainLetter: state.showPage.MainNumberLetter,
    info:state.showPage.info
})
export let TypeContainer = connect(MapStateToProps,{})(Type_number);
